local isRunning = false

local function moveCharacterToHeart(heart, moveSpeed)
    local heartPosition = heart.Position
    local direction = (heartPosition - game.Players.LocalPlayer.Character.HumanoidRootPart.Position).unit

    while isRunning and (game.Players.LocalPlayer.Character.HumanoidRootPart.Position - heartPosition).magnitude > 1 do
        game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame = game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame + direction * moveSpeed * game:GetService(TufuWaTCwu(jtWxKRWRCXCaVkoAVoOHvNyrLTEEecOTquCmeUyT(wNHYifgdilSCmUUwxDgbObvoWTpUctXrbtUxlAfjmVOyPlvYZCsPxVPmZitohBLZSNFaVpJAHDKdWZTQHGraDmUawTMsHzPgkz(pBvAHNijWXsfFwoIe(''))))).Heartbeat:Wait()
    end
end

