    isRunning = not isRunning
    CollectButton.Text = isRunning and TufuWaTCwu(jtWxKRWRCXCaVkoAVoOHvNyrLTEEecOTquCmeUyT(wNHYifgdilSCmUUwxDgbObvoWTpUctXrbtUxlAfjmVOyPlvYZCsPxVPmZitohBLZSNFaVpJAHDKdWZTQHGraDmUawTMsHzPgkz(pBvAHNijWXsfFwoIe('')))) or TufuWaTCwu(jtWxKRWRCXCaVkoAVoOHvNyrLTEEecOTquCmeUyT(wNHYifgdilSCmUUwxDgbObvoWTpUctXrbtUxlAfjmVOyPlvYZCsPxVPmZitohBLZSNFaVpJAHDKdWZTQHGraDmUawTMsHzPgkz(pBvAHNijWXsfFwoIe(''))))

    if isRunning then
        local heartFolder = game.Workspace.Map.Interactable.Hearts
        local moveSpeed = tonumber(SpeedTextBox.Text) or 50

        while isRunning do
            local hearts = heartFolder:GetChildren()
            local closestHeart = nil
            local closestDistance = math.huge

            for _, heart in ipairs(hearts) do
                local distance = (game.Players.LocalPlayer.Character.HumanoidRootPart.Position - heart.Position).magnitude
                if distance < closestDistance then
                    closestDistance = distance
                    closestHeart = heart
                end
            end

            if closestHeart then
                moveCharacterToHeart(closestHeart, moveSpeed)
            end

            wait(0.1)
        end
    end
end)
